window.bookSummaryJSON = "<p>With the third realm, new challenges arise. </p> <p>Erik searches for Old Hei while Rugrat deals with his broken mana system. For both, their path takes them toward the alchemist association's trial. </p> <p>They didn't mean to get into trouble, they swear, but in the ten realms, trouble is not far behind the duo. They'll have to fight across the third realm to complete the alchemist association's trial. </p> <p>All isn't peaceful in the first realm as Alva and Vermire will face one of their greatest challenges yet. </p> <p>Chaos or creation? There's no knowing what might happen in the ten realms.</p>"; 
